	<h4>Version 1.2.2 - Released on Sep 22, 2017</h4>
	<ul>
		<li>Update: Hybrid auth 2.9.6</li>
		<li>Update: Plugin Core</li>
		<li>Fix: Yahoo and Live callback address</li>
		<li>Fix: Double Social Icons in checkout page</li>
	</ul>
	<h4>Version 1.2.1 - Released on Jul 13, 2017</h4>
	<ul>
		<li>New: Support to WooCommerce 3.1.1</li>
		<li>Update: Plugin Core</li>
		<li>Dev: New filter yit_social_login_show_form</li>
		<li>Dev: New fiter ywpop_enable_the_registration</li>
	</ul>
	<h4>Version 1.2.0 - Released on Mar 31, 2017</h4>
	<ul>
		<li>New: Support to WooCommerce 3.0 RC 2</li>
		<li>Tweak: Spanish translation</li>
		<li>Update: Plugin Core 2.9.62</li>
		<li>Update: Language Files</li>
	</ul>
	<h4>Version 1.1.3 - Released on Feb 16, 2017</h4>
	<ul>
		<li>Fix: Issue when are called functions include/require in hybridauth library</li>
		<li>Fix: Removed hash on url after login</li>
		<li>Dev: removed user_register action</li>
		<li>Update: Plugin Framework</li>
	</ul>

	<h4>Version 1.1.2 - Released on Dec 28, 2016</h4>
	<ul>
		<li>Added: Action to send email to customer after the registration</li>
		<li>Fixed: Social Connection in My Account page</li>
		<li>Updated: Hybrid Library 2.8.2</li>
	 </ul>
	<h4>Version 1.1.1 - Released on Nov 02, 2016</h4>
	<ul>
	    <li>Fixed: removed filters for some social providers</li>
	 </ul>
	<h4>Version 1.1.0 - Released on Oct 25, 2016</h4>
    <ul>
        <li>Added: 'yith_ywsl_facebook_scope' filter to change the default Facebook permissions</li>
        <li>Added: 'yith_ywsl_google_scope' filter to change the default Google permissions</li>
        <li>Added: 'yith_ywsl_vk_scope' filter to change the default Vkontakte permissions</li>
        <li>Added: 'yith_ywsl_live_scope' filter to change the default Live permissions</li>
        <li>Added: 'yith_ywsl_instagram_scope' filter to change the default Instagram permissions</li>
        <li>Fixed: shortcode 'yith_wc_social_login'</li>
    </ul>
    <h4>Version 1.0.9 - Released on Jul 22, 2016</h4>
